import { getUrl } from "../apis/api";


const getLink = async (stringUrl) => {
    var shortUrl= await getUrl({stringUrl});
    return shortUrl;
}

const RedirectPage =  () => {

    var stringUrl= window.location.pathname ;
    if(stringUrl.length!==0){
        stringUrl = stringUrl.substring(1);
    }

    const target=getLink(stringUrl);;

    window.location.href= target;
    return null;


    // window.location.href = 'https://google.com';
    // return null;

    return (
        <h5>Mapped value: {stringUrl} </h5>
    );

